import Title from '../title';
import './styles.css';
export default function Cont1() {
  return (
    <section className="w-[100%] h-[100%] flex z-1 items-center pt-[46px] sm:px-[100px] px-[20px] flex-col bec">
      <Title title={'autoridade'} description={'bla bla bla'} />

      <div className="flex-row-reverse">
        <div className="8">
          <img
            className="absolute left-0 mr-12 top-0 w-[37rem] max-w-none rounded-md"
            src={`${process.env.PUBLIC_URL}/../../../assets/web.png`}
            alt="App screenshot"
            width={1824}
            height={1080}
          />
        </div>

        <div className="flex-col"></div>
      </div>
    </section>
  );
}
